Change Parameter through Keyboard.update:
for (var keyCode in pins.keyMap) {
  if (pins.keysDown[keyCode]) {
    var value = pins.keyMap[keyCode];
    if (_.isString(value) && value.length > 0 && (value[0] == '+' || value[0] == '-')) {
      pins.parameter += Number(value);
    } else {
      pins.parameter = value;
    }
    break;
  }
}

Move thing with arrow keys.update:
if(pins.keysDown[37]) pins.position[0] -= pins.speed;
if(pins.keysDown[39]) pins.position[0] += pins.speed;
if(pins.keysDown[38]) pins.position[1] -= pins.speed;
if(pins.keysDown[40]) pins.position[1] += pins.speed;

Detect Mouse.update:
if (!pins.state)
  pins.state = 'none';
switch (pins.state) {
case 'none':
  if (pins.mousePosition) {
    for (var i in pins.shapes) {
      if (transformers.pointIntersectsShape(pins.mousePosition, pins.shapes[i])) {
        //log(RW.logLevels.INFO, 'Entering hover mode. Old state = ' + pins.state);
        pins.state = 'hover';
        pins.shape = pins.shapes[i];
        break;
      }
    }
  }
  break;
case 'hover':
  if (!pins.mousePosition || !transformers.pointIntersectsShape(pins.mousePosition, pins.shape)) {
    pins.state = 'none';
    pins.shape = null;
    //log(RW.logLevels.INFO, 'Leaving hover mode');
  } else if (pins.mouseDown) {
    pins.dragStartPosition = pins.mousePosition;
    pins.state = 'pressed';
    //log(RW.logLevels.INFO, 'Entering presed mode');
  }
  break;
case 'pressed':
  if (!pins.mouseDown) {
    pins.state = 'click';
    pins.dragStartPosition = null;
    //log(RW.logLevels.INFO, 'Leaving pressed mode');
  } else if (Vector.create(pins.dragStartPosition).distanceFrom(Vector.create(pins.mousePosition)) >= pins.minimumDragDistance) {
    pins.state = 'startDrag';
    pins.dragStartPosition = null;
    //log(RW.logLevels.INFO, 'Entering drag mode');
  }
  break;
case 'click':
  pins.state = 'hover';
  break;
case 'startDrag':
  pins.state = 'drag';
  break;
case 'drag':
  if (!pins.mouseDown) {
    pins.state = 'endDrag';
    pins.dragStartPosition = null;
    //log(RW.logLevels.INFO, 'Leaving drag mode');
  }
  break;
case 'endDrag':
  pins.state = 'hover';
  break;
default:
  throw new Error('Unknown state \'' + pins.state + '\'');
}

Update HTML Template.update:
if (!pins.htmlService.receive[pins.templateName]) {
  pins.htmlService.send[pins.templateName] = {
    asset: pins.assetName,
    values: pins.memoryValues
  };
} else {
  pins.memoryValues = pins.htmlService.receive[pins.templateName].values;
  pins.htmlService.send[pins.templateName] = pins.htmlService.receive[pins.templateName];
}

Prepare selection block shapes.update:
var pageIndex, shapeIndexOnPage;
var galleryIndex = 0;

pins.selectionBlockShapes = [];
for(pageIndex = 0; pageIndex < pins.selectionGalleryGrids.length; pageIndex++) {
    pins.selectionBlockShapes.push([]);
    for(shapeIndexOnPage = 0; shapeIndexOnPage < pins.selectionGalleryGrids[pageIndex].length; shapeIndexOnPage++) {
        var selectionGrid = pins.selectionGalleryGrids[pageIndex][shapeIndexOnPage];
        var blocks = pins.gallery[galleryIndex];

        var selectionBlocks = transformers.translateShapes(transformers.inverseVector(transformers.findCenterOfCells(selectionGrid, blocks)), transformers.makeBlockShapes(selectionGrid, blocks, transformers.rgbColorString(pins.blockColor), pins.blockSize));

        // Copy new block shapes into correct page
        Array.prototype.push.apply(pins.selectionBlockShapes[pageIndex], selectionBlocks);

        galleryIndex++;
    }
}

Do One at a Time.handleSignals:
if (signals[pins.activeChild] == RW.signals.DONE)
  pins.activeChild++;
if (pins.activeChild > children.length - 1) {
  pins.activeChild = 0;
  return RW.signals.DONE;
}

Sandwhich.listActiveChildren:
if (!pins.track) {
  if (!pins.condition) {
    return [children[0]];
  } else {
    pins.track = true;
    return [children[1]];
  }
} else {
  if (pins.condition) {
    return [children[1]];
  } else {
    pins.track = false;
    return [children[2]];
  }
}

drawShape.body:
var shapes = oldShapes || {};
shapes[_.uniqueId()] = shape;
return shapes;

pointIntersectsShape.body:
if (!shape.fillStyle && !shape.strokeStyle)
  return false;
switch (shape.type) {
case 'circle':
  var center = Vector.create(shape.center);
  if (shape.translation)
    center = center.add(shape.translation);
  var lineWidth = shape.lineWidth || 1;
  var scale = shape.scale || 1;
  var minDistance = shape.fillStyle ? 0 : shape.radius - lineWidth;
  var maxDistance = shape.strokeStyle ? shape.radius + lineWidth : shape.radius;
  var distance = center.distanceFrom(Vector.create(point));
  return distance >= minDistance * scale && distance <= maxDistance * scale;
case 'rectangle':
  var pointInShapeFrame = Vector.create(point);
  if (shape.translation)
    pointInShapeFrame = pointInShapeFrame.subtract(shape.translation);
  return pointInShapeFrame.elements[0] >= shape.position[0] && pointInShapeFrame.elements[0] <= shape.position[0] + shape.size[0] && pointInShapeFrame.elements[1] >= shape.position[1] && pointInShapeFrame.elements[1] <= shape.position[1] + shape.size[1];
default:
  throw new Error('Shape type \'' + shape.type + '\' is not supported');
}

removeElement.body:
var newArray = [];
for (var i = 0; i < tab.length; i++) {
  if (i != index)
    newArray.push(tab[i]);
}
return newArray;

gridCellAtPoint.body:
if (point === null)
  return null;
var gridPos = [
    Math.floor((point[0] - grid.upperLeft[0]) / grid.cellSize[0]),
    Math.floor((point[1] - grid.upperLeft[1]) / grid.cellSize[1])
  ];
if (grid.type != 'infinite' && (gridPos[0] < 0 || gridPos[0] > grid.gridSize[0] || gridPos[1] < 0 || gridPos[1] > grid.gridSize[1]))
  return null;
else
  return gridPos;

gridCellToPoint.body:
return [
  (cell[0] + proportions[0]) * grid.cellSize[0] + grid.upperLeft[0],
  (cell[1] + proportions[1]) * grid.cellSize[1] + grid.upperLeft[1]
];

gridCellRectangle.body:
return {
  type: 'rectangle',
  position: transformers.gridCellUpperLeft(grid, cell),
  size: grid.cellSize,
  meta: meta
};

calculateRotationAngle.body:
var h = [
    mousePosition[0] - center[0],
    mousePosition[1] - center[1]
  ];
var omDistance = Math.sqrt(h[0] * h[0] + h[1] * h[1]);
var ratio = -h[1] / omDistance;
var angle = 0;
if (omDistance !== 0) {
  var absValueAngle = Math.acos(ratio) * 180 / Math.PI;
  if (h[0] <= 0) {
    angle = -absValueAngle;
  } else {
    angle = absValueAngle;
  }
}
return angle;

makeGridCoveringRectangle.body:
return {
  meta: meta,
  type: 'rectangle',
  position: grid.upperLeft,
  size: transformers.gridSizeInPixels(grid),
  strokeStyle: 'white',
  fillStyle: 'white'
};

meanOfCoordinates.body:
var sum = _.reduce(coordinates, function (memo, cell) {
    return [
      memo[0] + cell[0],
      memo[1] + cell[1]
    ];
  }, [
    0,
    0
  ]);
return [
  sum[0] / coordinates.length,
  sum[1] / coordinates.length
];

findCenterOfCells.body:
if (cells.length == 0)
  return [
    0,
    0
  ];
var gridCenter = transformers.gridCenter(grid);
var sum = _.reduce(cells, function (memo, cell) {
    return [
      memo[0] + cell[0] + 0.5,
      memo[1] + cell[1] + 0.5
    ];
  }, [
    0,
    0
  ]);
return [
  sum[0] * grid.cellSize[0] / cells.length - gridCenter[0],
  sum[1] * grid.cellSize[1] / cells.length - gridCenter[1]
];

makeBlockShapes.body:
var that = transformers;
return _.map(blocks, function (block) {
  return _.extend(that.gridCellRectangle(grid, block, block), {
    layer: 'blocks',
    fillStyle: blockColor,
    size: blockSize
  });
});

makeMovableBlockShapes.body:
var that = transformers;
var movableBlocks = _.filter(blocks, function (block) {
    return that.canMoveBlock(blocks, block);
  });
return _.map(movableBlocks, function (block) {
  return _.extend(that.gridCellRectangle(grid, block, block), {
    layer: 'blocks',
    fillStyle: blockColor,
    size: blockSize
  });
});

makeDraggedShape.body:
return {
  layer: 'drag',
  type: 'rectangle',
  position: [
    mousePosition[0] - size[0] / 2,
    mousePosition[1] - size[1] / 2
  ],
  size: size,
  fillStyle: color
};

drawShapes.body:
var that = transformers;
return _.reduce(shapes, function (memo, shape) {
  return that.drawShape(shape, memo);
}, {});

blocksAreNeighbors.body:
var diff = [
    Math.abs(a[0] - b[0]),
    Math.abs(a[1] - b[1])
  ];
return diff[0] == 1 && diff[1] == 0 || diff[0] == 0 && diff[1] == 1;

makeAdjacencyList.body:
var adjList = _.map(blocks, function () {
    return [];
  });
for (var i = 0; i < blocks.length - 1; i++) {
  for (var j = i + 1; j < blocks.length; j++) {
    if (transformers.blocksAreNeighbors(blocks[i], blocks[j])) {
      adjList[i].push(j);
      adjList[j].push(i);
    }
  }
}
return adjList;

visitBlocks.body:
var visited = [startingIndices];
while (true) {
  var toVisit = _.reduce(visited[visited.length - 1], function (memo, visitingIndex) {
      return memo.concat(adjList[visitingIndex]);
    }, []);
  toVisit = _.uniq(toVisit);
  toVisit = _.difference.apply(_, [toVisit].concat(visited));
  if (toVisit.length > 0) {
    visited.push(toVisit);
  } else {
    return visited;
  }
}

canMoveBlock.body:
var blocksWithout = transformers.removeElement(blocks, RW.indexOf(blocks, block));
var adjList = transformers.makeAdjacencyList(blocksWithout);
var visited = transformers.visitBlocks(adjList, [0]);
return _.flatten(visited).length == blocksWithout.length;

findFreeBlockPositions.body:
var freePositions = [];
_.each(blocks, function (block) {
  freePositions.push([
    block[0] + 1,
    block[1]
  ]);
  freePositions.push([
    block[0] - 1,
    block[1]
  ]);
  freePositions.push([
    block[0],
    block[1] + 1
  ]);
  freePositions.push([
    block[0],
    block[1] - 1
  ]);
});
freePositions = RW.uniq(freePositions);
return RW.difference(freePositions, blocks);

translateShapes.body:
var newShapes = _.map(shapes, function (shape) {
    return _.extend(shape, {
      position: [
        shape.position[0] + translation[0],
        shape.position[1] + translation[1]
      ]
    });
  });
return newShapes;

makeSelectionGalleryGrids.body:
var that = transformers;

var galleryGrids = [];

var pageIndex, shapeIndexOnPage;
for(pageIndex = 0; pageIndex < gallery.length / galleryShapesPerPage; pageIndex++) {
    galleryGrids.push([]);
    for(shapeIndexOnPage = 0; shapeIndexOnPage < galleryShapesPerPage && pageIndex * galleryShapesPerPage + shapeIndexOnPage < gallery.length; shapeIndexOnPage++) {
        var cell = that.gridIndexToCell(selectionGrid, shapeIndexOnPage);
        galleryGrids[pageIndex].push({
            type: 'infinite',
            'upperLeft': that.gridCellUpperLeft(selectionGrid, cell),
            'cellSize': [
                selectionGrid.cellSize[0] / galleryGrid.gridSize[0], 
                selectionGrid.cellSize[1] / galleryGrid.gridSize[1]],
            'gridSize': galleryGrid.gridSize            
        });
    }
}

return galleryGrids;

makeSelectionGalleryShapes.body:
var that = transformers;
return _.map(selectionGrids[galleryPage], function (selectionGrid, indexOnPage) {
  return _.extend(that.makeGridCoveringRectangle(selectionGrid, indexOnPage), {
    fillStyle: RW.contains(selectedGalleryIndexes, galleryPage * galleryShapesPerPage + indexOnPage) ? 'firebrick' : 'darkgrey',
    strokeStyle: 'white',
    layer: 'gallery'
  });
});

serializeBlocks.body:
var min = _.reduce(blocks, function (memo, block) {
    return [
      Math.min(memo[0], block[0]),
      Math.min(memo[1], block[1])
    ];
  }, [
    Infinity,
    Infinity
  ]);

var rowNumbers = _.map(_.range(10), function () {
    return 0;
});

_.each(blocks, function (block) {
  var index = block[1] - min[1];
  rowNumbers[index] = rowNumbers[index] | 1 << 9 - (block[0] - min[0]);
});

// Remove empty rows
rowNumbers = _.without(rowNumbers, 0);

return rowNumbers.join("_");

findDroppedPosition.body:
var that = transformers;
var hoveredCell = transformers.gridCellAtPoint(grid, mousePosition);
if (!hoveredCell)
  return blocks;
var freeBlockPositions = transformers.findFreeBlockPositions(blocks);
return _.min(freeBlockPositions, function (block) {
  return that.distanceBetweenPoints(hoveredCell, block);
});

makeBlockGroupsToBeHighlighted.body:
//log(RW.logLevels.INFO, 'makeBlockGroupsToBeHighlighted', arguments);
var newBlocks = RW.appendToArray(blocks, newPosition);
var adjList = transformers.makeAdjacencyList(newBlocks);
var visitedBlockIndexes = _.rest(transformers.visitBlocks(adjList, [newBlocks.length - 1]));
return _.map(visitedBlockIndexes, function (blockIndexes) {
  return _.map(blockIndexes, function (index) {
    return newBlocks[index];
  });
});

adjustShapesByMeta.body:
return _.map(shapes, function (shape) {
  if (_.isEqual(shape.meta, meta)) {
    return _.extend(RW.clone(shape), properties);
  } else {
    return shape;
  }
});

interpolateVector.body:
return _.map(_.zip(start, end), function (pair) {
  return pair[0] + fraction * (pair[1] - pair[0]);
});

rgbColorString.body:
var flooredArray = _.map(colorArray, function (value) {
    return Math.floor(value);
  });
return 'rgb(' + flooredArray.join(', ') + ')';

makeTrackingString.body:
return JSON.stringify({
  player: player,
  events: events
});

calculateStatistics.body:
var stats = {};

stats.foundShapeCount = foundShapes.length;

// Split the found shapes into two arrays, ones that exist in the tables and ones who don't
var foundShapeInfo = [];
var newShapes = [];
for(var i = 0; i < foundShapes.length; i++) {
    var shapeInfo = shapesTable[transformers.serializeBlocks(foundShapes[i])];
    if(shapeInfo) 
        foundShapeInfo.push(shapeInfo);
    else
        newShapes.push(foundShapes[i]);
}

stats.newShapeCount = newShapes.length;

// Find unique categories from the shapes the player found.
var categories = _.chain(foundShapeInfo).pluck("categories").flatten().union().value();
stats.categoryCount = categories.length;

var createdCounts = _.chain(foundShapeInfo).sortBy(function(shapeInfo) { return -1 * shapeInfo.uniqueness; }).take(5).pluck("createdCount").value();
var createdCountSum = _.reduce(createdCounts, function(memo, value) {return memo + value; }, 0);
stats.meanCreated = Math.round(createdCountSum / createdCounts.length);

var shapesChosenOnce = _.filter(foundShapeInfo, function(shapeInfo) { return shapeInfo.chosenCount > 1; });
stats.beautifulPercent = Math.round(100 * shapesChosenOnce.length / foundShapeInfo.length);

var shapesChosenOften = _.filter(foundShapeInfo, function(shapeInfo) { return shapeInfo.chosenCount > 15; });
stats.foundPopularShape = shapesChosenOften.length > 0;

stats.searchScore = transformers.calculateSearchScore(foundShapes.length, collectTime);
stats.searchScorePercent = Math.round(Math.abs(stats.searchScore) * 100);
stats.searchStyle = stats.searchScore < 0 ? "thorough and thoughtful" : "fast and exhaustive"; 
stats.searchResults = stats.searchScore < 0 ? "meaningful" : "unique"; 

return stats;

listMovableBlocks.body:
var that = transformers;
var movableBlocks = _.filter(blocks, function (block) {
    return that.canMoveBlock(blocks, block);
});
return movableBlocks;
